class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        i=0
        j=-1
        while i < len(s):
            tt=t[j+1:]
            if s[i] in tt:
                j=tt.index(s[i])+j+1
            else:
                return False
            i=i+1
        return True

